import React from "react";

function Login() {
  return (
    <>
      <div className="container-fluid">
        <div className="row" >
          <form
            action=""
            className=""
          >
            <h1>login from</h1>
            <input type="text" className="" placeholder="Email" />
            <input type="password" placeholder="Password" />
          </form>
        </div>
      </div>
    </>
  );
}

export default Login;
